import React, { useState } from 'react';
import './Paiement.css';

const Paiement = () => {
  const [formData, setFormData] = useState({
    nom: '',
    email: '',
    adresse: '',
    ville: '',
    region: '',
    codePostal: '',
    nomCarte: '',
    numeroCarte: '',
    moisExpiration: '',
    anneeExpiration: '',
    cvv: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert('Votre commande a bien été enregistrée. Merci !');
    // Ici, tu peux ajouter l'envoi vers une API
  };

  return (
    <form className="payment-form" onSubmit={handleSubmit}>
      <h2>Paiement</h2>
      <label>Nom complet :</label>
      <input
        type="text"
        name="nom"
        placeholder="brahim soumia"
        value={formData.nom}
        onChange={handleChange}
        required
      />

      <label>Email :</label>
      <input
        type="email"
        name="email"
        placeholder="exemple@exemple.com"
        value={formData.email}
        onChange={handleChange}
        required
      />

      <label>Adresse :</label>
      <input
        type="text"
        name="adresse"
        placeholder="appartement - rue - quartier"
        value={formData.adresse}
        onChange={handleChange}
        required
      />

      <label>Ville :</label>
      <input
        type="text"
        name="ville"
        placeholder="souk el arbaa"
        value={formData.ville}
        onChange={handleChange}
        required
      />

      <label>Région :</label>
      <input
        type="text"
        name="region"
        placeholder="maroc"
        value={formData.region}
        onChange={handleChange}
        required
      />

      <label>Code postal :</label>
      <input
        type="text"
        name="codePostal"
        placeholder="20000"
        value={formData.codePostal}
        onChange={handleChange}
        required
      />

      <label>Cartes acceptées :</label>
      <img src="/card_img.png" alt="Cartes acceptées" style={{ height: 34, marginBottom: 10 }} />

      <label>Nom sur la carte :</label>
      <input
        type="text"
        name="nomCarte"
        placeholder="m. brahim soumia"
        value={formData.nomCarte}
        onChange={handleChange}
        required
      />

      <label>Numéro de carte :</label>
      <input
        type="text"
        name="numeroCarte"
        placeholder="1111-2222-3333-4444"
        value={formData.numeroCarte}
        onChange={handleChange}
        required
      />

      <label>Mois d'expiration :</label>
      <input
        type="text"
        name="moisExpiration"
        placeholder="mars"
        value={formData.moisExpiration}
        onChange={handleChange}
        required
      />

      <label>Année d'expiration :</label>
      <input
        type="text"
        name="anneeExpiration"
        placeholder="2023"
        value={formData.anneeExpiration}
        onChange={handleChange}
        required
      />

      <label>CVV :</label>
      <input
        type="text"
        name="cvv"
        placeholder="1234"
        value={formData.cvv}
        onChange={handleChange}
        required
      />

      <button type="submit">Valider</button>
    </form>
  );
};

export default Paiement;
